import { create } from '../tasks'

export const fetchRandomGif = create(async (topic) =>  {
  try {
    const resp = await fetch(`https://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&topic=${topic}`)
    const json = await resp.json()
    return json.data.image_url
  } catch (e) {
    return FAILED_GIF_DATA_URI
  }
})

const FAILED_GIF_DATA_URI = 'data:image/gif;base64,'